import './FriendCard.css';

function FriendCard({friend}) {
  //Delete to friend? button
  //info about futures dates

  return ( 
    <div className="friendCard__container">
      <img className="friendCard__img" 
        alt = {friend.name} 
        src = {friend.link}
      />
      <p className="friendCard__friendsName">{friend.name}</p>
      <p className="friendCard__friendsName">Delete</p>
    </div>
  );
}

export default FriendCard;
